import React, { useState } from 'react';

import GroceryList from './GroceryList';      // Lab 1
import Car from './Car';                     // Lab 2
import Phone from './Phone';                 // Lab 3
import SweetsList from './SweetsList';       // Lab 4
import Electronics from './Electronics';     // Lab 5
import CanteenMenu from './CanteenMenu';     // Lab 6
import JuiceList from './JuiceList';         // Lab 7
import Restaurant from './Restaurant';       // Lab 8
import TempleList from './TempleList';       // Lab 9

function App() {
  const [lab, setLab] = useState('');
  const groceries = ['Rice', 'Wheat', 'Sugar', 'Milk', 'Oil'];

  return (
    <div className="App">
      <h1>React Labs Project</h1>

      {/* Button Menu */}
      <button onClick={() => setLab('lab1')}>Lab 1 - GroceryList</button>
      <button onClick={() => setLab('lab2')}>Lab 2 - Car Component</button>
      <button onClick={() => setLab('lab3')}>Lab 3 - Phone</button>
      <button onClick={() => setLab('lab4')}>Lab 4 - Sweets List</button>
      <button onClick={() => setLab('lab5')}>Lab 5 - Electronics</button>
      <button onClick={() => setLab('lab6')}>Lab 6 - Canteen Menu</button>
      <button onClick={() => setLab('lab7')}>Lab 7 - Juice List</button>
      <button onClick={() => setLab('lab8')}>Lab 8 - Restaurant Menu</button>
      <button onClick={() => setLab('lab9')}>Lab 9 - Temple List</button>

      <br /><br />

      {/* Conditional Rendering */}
      {lab === 'lab1' && <GroceryList items={groceries} />}
      {lab === 'lab2' && <Car brand="Toyota" model="Fortuner" color="Black" year="2022" />}
      {lab === 'lab3' && <Phone />}
      {lab === 'lab4' && <SweetsList />}
      {lab === 'lab5' && <Electronics />}
      {lab === 'lab6' && <CanteenMenu />}
      {lab === 'lab7' && <JuiceList />}
      {lab === 'lab8' && <Restaurant />}
      {lab === 'lab9' && <TempleList />}
    </div>
  );
}

export default App;
